
select l.id_lugar as i_parr, l.nombre_lugar as parroquia, l2.nombre_lugar as estado from lugar l, lugar l2, lugar l3 where l.fk_lugar = l3.id_lugar and l3.fk_lugar = l2.id_lugar order by l2.nombre_lugar;
#usuarios

select p.nombre_persona, p.apellido_persona, l.nombre_lugar from PERSONA p, LUGAR l where p.fk_lugar = l.id_lugar;
select count(p.nombre_persona), l.nombre_lugar from PERSONA p, LUGAR l, lugar l2, lugar l3 where p.fk_lugar = l3.id_lugar and l3.fk_lugar = l2.id_lugar and l2.fk_lugar = l.id_lugar group by l.nombre_lugar;
select u.nombre_usuario, p.nombre_persona, p.apellido_persona, p.correo_persona from usuario u, persona p where u.fk_persona=p.cedula_persona;
select count(u.nombre_usuario), p.nombre_persona from usuario u, persona p where u.fk_persona = p.cedula_persona group by p.nombre_persona;
select count(*) from usuario;
select l.id_lugar as i_parr, l.nombre_lugar as parroquia, l2.nombre_lugar as estado from lugar l, lugar l2, lugar l3 where l.fk_lugar = l3.id_lugar and l3.fk_lugar = l2.id_lugar and l2.id_lugar = 24 order by l2.nombre_lugar;
select p.fk_lugar, p.nombre_persona, l.nombre_lugar from persona p, lugar l, lugar l2, lugar l3 where p.fk_lugar = l3.id_lugar and l3.fk_lugar = l2.id_lugar and l2.fk_lugar = l.id_lugar;